class WhoisAPI {
  constructor() {
    this.http = new XMLHttpRequest();
    this.baseURL = 'localhost:5001/';
  }

  async getDomainInfo(domain) {
    const url = this.baseURL + "lookup/";
    this.http.open("GET", url);
    this.http.send();
  }
}
